L’alimentation en eau potable (sigle : AEP) est l’ensemble des équipements, des services et des actions qui permettent, en partant d’une eau brute, de produire une eau conforme aux normes de potabilité en vigueur, distribuée ensuite aux consommateurs. On considère quatre étapes distinctes dans cette alimentation : 
* prélèvements - captages (eau de surface ou eau souterraine) ; 
* traitement pour potabiliser l'eau ; 
* adduction (transport et stockage) ; 
* distribution au consommateur.

